import React from 'react';
import Link from 'next/link';


const navLink = [
    {
        title: 'HOME',
        path:'/'
    },
    {
        title: 'PRODUCTS',
        path:'/products'
    },
    {
        title: 'CARTS',
        path:'/carts'
    },
    {
        title: 'SIGNIN',
        path:'/signin'
    },
    {
        title: 'SIGNUP',
        path:'/signup'
    }
]

function Navigation() {
    return(
        <nav className="site-navigation">
            <span className="menu-title">Cubiz Store</span>
            <ul>
                { navLink.map((link, index) => (
                     <li key={index}>
                        <Link href={link.path}>
                            <a>{link.title}</a>
                        </Link>
                     </li>
                ))
                }
            </ul>
        </nav>
    )
}

export default Navigation;
